import IntrestForm from "./InputForm";

export default function Card(){
    return (
      <div>
        <IntrestForm />
        <p className="actions">
          <button type="reset" className="buttonAlt">
            Reset
          </button>
          <button type="submit" className="button">
            Calculate
          </button>
        </p>
      </div>
    );
}
